// src/components/BlogPost.js
import React from 'react';

function BlogPost({ id }) {
  // This would typically fetch from an API based on the id
  const post = {
    title: `Blog Post ${id}`,
    content: 'This is the content of the blog post.',
  };

  return (
    <article>
      <h1>{post.title}</h1>
      <p>{post.content}</p>
    </article>
  );
}

export default BlogPost;
